int rump_sys_pipe(int *);
int
rump_sys_pipe(int *fd)
{
	register_t retval[2] = {0, 0};
	int error = 0;

	error = rsys_syscall(SYS_pipe, NULL, 0, retval);
	if (error) {
		rsys_seterrno(error);
	} else {
		fd[0] = retval[0];
		fd[1] = retval[1];
	}
	return error ? -1 : 0;
}

